cy.get("#modalEditarCotizacion").should("be.visible");
// --- EDITAR CAMPOS ---
cy.get('#modalEditarCotizacion input[name="cliente"]').clear().type(escenario.cliente);
cy.get('#modalEditarCotizacion input[name="descripcion"]').clear().type(escenario.descripcion);
// Producto: dropdown custom
cy.get("#modalEditarCotizacion .cotizacion-select-input").click();
cy.get(`#modalEditarCotizacion .cotizacion-select-option[data-codigo="${escenario.producto}"]`).click({
  force: true
});
cy.get('#modalEditarCotizacion input[name="productosCotizacion[1][descripcion]"]').clear().type(escenario.productoDescripcion);
cy.get('#modalEditarCotizacion input[name="productosCotizacion[1][cantidad]"]').clear().type(escenario.cantidad);
cy.get('#modalEditarCotizacion input[name="productosCotizacion[1][descuento]"]').clear().type(escenario.descuento);
cy.get('#modalEditarCotizacion select[name="productosCotizacion[1][iva]"]').select(escenario.iva);
// --- GUARDAR CAMBIOS ---
cy.get("#modalEditarCotizacion div.modal-footer.bg-light").contains("Actualizar Cotización").click();
// Esperar que el modal de edición se oculte (no visible)
cy.get("#modalEditarCotizacion", {
  timeout: 10000
}).should("not.be.visible");

